// реализовать шаблонную версию Vector
// реализовать список инициализации

#include <iostream>

using namespace std;

class Vector {

public:

	Vector() : size(0), capacity(4), arr(new int[4]) {}

	Vector(const int vector_capacity) : size(0), capacity(vector_capacity), arr(new int[vector_capacity]) {}

	Vector(const Vector& other) : size(other.size), capacity(other.capacity), arr(new int[capacity]) {
		for (int i = 0; i < size; i++) {
			arr[i] = other.arr[i];
		}
		total_number_elements += size;
	}

	Vector& operator=(const Vector& other) {
		if (&other != this) {
			total_number_elements -= size;
			size = other.size;
			capacity = other.capacity;
			delete[] arr;
			arr = new int[capacity];
			for (int i = 0; i < size; i++) {
				arr[i] = other.arr[i];
			}
			total_number_elements += size;
		}
		return *this;
	} // копирующий оператор присваивания =

	Vector(Vector&& other) : size(other.size), capacity(other.capacity), arr(other.arr) {
		other.arr = nullptr;
		other.size = 0;
		other.capacity = 0;
	} // конструктор перемещения

	Vector& operator=(Vector&& other) {
		if (&other != this) {
			total_number_elements -= size;
			size = other.size;
			capacity = other.capacity;
			delete[] arr;
			arr = other.arr;
			other.arr = nullptr;
			other.size = 0;
			other.capacity = 0;
			total_number_elements += size;
		}
		return *this;
	} // перемещающий оператор присваивания =

	int& operator[] (const int index) {
		if (index < 0 || index >= size) {
			cout << "Invalid index" << endl;
			abort;
		}
		return arr[index];
	} // перегрузка оператора индексирования (сеттер)

	int operator[] (const int index) const {
		if (index < 0 || index >= size) {
			cout << "Invalid index" << endl;
			abort;
		}
		return arr[index];
	} // перегрузка оператора индексирования для константных объектов

	bool operator==(const Vector& right) const {
		if (right.size != size) {
			return false;
		}
		for (int i = 0; i < size; i++) {
			if (arr[i] != right.arr[i])
				return false;
		}
		return true;
	}

	bool operator!=(const Vector& right) const {
		return !(*this == right);
	}

	void Push_back(const int value) {
		if (size == capacity) {
			int* temp = new int[capacity * 2];
			for (int i = 0; i < size; i++) {
				temp[i] = arr[i];
			}
			delete[] arr;
			arr = temp;
			capacity *= 2;
		}
		arr[size] = value;
		size++;
		total_number_elements++;
	}

	void Pop_back() {
		if (size > 0) {
			arr[size - 1] = 0;
			size--;
			total_number_elements--;
		}
	}

	int Size() {
		return size;
	}


	int Capacity() {
		return capacity;
	}

	void Insert(const int index, const int value) {
		if (index < 0 || index >= size) {
			cout << "Invalid index" << endl;
			return;
		}
		if (size == capacity) {
			int* temp = new int[capacity * 2];
			for (int i = 0; i < size; i++) {
				temp[i] = arr[i];
			}
			delete[] arr;
			arr = temp;
			capacity *= 2;
		}
		for (int i = size; i > index; i--) {
			arr[i] = arr[i - 1];
		}
		arr[index] = value;
		size++;
		total_number_elements++;
	}

	void Erase(const int index) {
		if (index < 0 || index >= size) {
			cout << "Invalid index" << endl;
			return;
		}
		for (int i = index; i < size - 1; i++) {
			arr[i] = arr[i + 1];
		}
		arr[size - 1] = 0;
		size--;
		total_number_elements--;
	}

	int GetValue(const int index) {
		if (index < 0 || index >= size) {
			cout << "Invalid index" << endl;
			abort;
		}
		return arr[index];
	}

	void SetValue(const int index, const int value) {
		if (index < 0 || index >= size) {
			cout << "Invalid index" << endl;
			return;
		}
		arr[index] = value;
	}

	static int GetTotalNumberElements() {
		return total_number_elements;
	}


	~Vector() {
		delete[] arr;
		total_number_elements -= size;
	}

private:
	int size;
	int capacity;
	int* arr;
	static int total_number_elements;
};

int Vector::total_number_elements = 0;

int main() {

	Vector my_vector;

	my_vector.Push_back(10);

