class Diamond {
	public static String print(int n) {
	  String space = " ";
	  String diamond = space.repeat((n-1)/2) +"*";
	  if (n % 2 == 0){
		return null;
	  }
    if (n <= 0){
      return "count is negative: " + n;
    }
	  if ((n+1)/2 == 1){
		return diamond + "\n";
	  }
	  int size = 1;
	  String asterik = "*";
	  while(size < ((n+1)/2)){
      diamond = diamond + "\n" + space.repeat((n-1)/2 - size) + asterik.repeat(2 *size + 1);
	  size++;
	  }
	  int lol = 1;
	  while(lol  < (n + 1)/2){
      diamond = diamond + "\n" + space.repeat(lol) + asterik.repeat(n - 2 * lol);
	  lol++;
	  }
	  
	  return diamond + "\n";
	  }
  }

