    {

       BackLightState = true;
       BackLightOnTime = 7; 
       BackLightOffTime = 23;
       
       Serial.begin(9600);
       lcd.begin(); 
       lcd.backlight();
       lcd.clear();
       //AfiseazaPrezentarea();   
       lcd.clear();           
       lcd.setCursor(0,0);
       lcd.print("ERZEKELOK");
       lcd.setCursor(0,1);
       lcd.print("ELLENORZESE");        
       delay(2000);
       lcd.clear();      
   
       dht.begin();  
       VerificaDHTsensor();     
       if (!bmp280.begin(BMP280_I2C_ADDRESS))
          {  
             Serial.println("Nem található érvényes BMP280 érzékelő, ellenőrizze a vezetékeket!");
            // lcd.clear();
             lcd.setCursor(0,1);
